import TodoTemplate from "./component/TodoTemplate";
import './index.css';
import TodoInsert from "./component/TodoInsert";
import TodoList from "./component/TodoList";

function App() {
  return (
    <>
      <TodoTemplate>
          <TodoInsert/>
          <TodoList/>
      </TodoTemplate>
    </>
  );
}

export default App;
